function Title(text){
    return (
        <h3>
            {text}
        </h3>
    )
}
function Photo({url}){
    return(
    <img className="w-3/4" src={url}/>
    )
}

export default function PhotoShowcase({}){
    return(
        <div>
            <Photo url="https://u.cubeupload.com/bostonessary/1.jpg"/>
            <Photo url={"https://u.cubeupload.com/bostonessary/2.jpg"}/>
            <Photo url={"https://u.cubeupload.com/bostonessary/3.jpg"}/>
        </div>
    )
}
